import React, { useState } from "react";
function App() {
  const [counter, setCounter] = useState(0);

  const handleIncreaseCounter = () => {
    setCounter((prevState) => {
      return prevState + 1;
    });
  };

  return (
    <div className="App">
      <div>{counter}</div>
      <button
        onClick={() => {
          handleIncreaseCounter();
        }}
      >
        increase
      </button>
    </div>
  );
}

export default App;
